const showPrinterModal = document.getElementById('showPrinterModal');
const printerModal = document.getElementById('printerModal');
const printerModalInstance = bootstrap.Modal.getOrCreateInstance(printerModal);
const printerSelect = document.getElementById('printerSelect');
const savePrinterButton = document.getElementById('savePrinterButton');

const showShipmentModal = document.getElementById('showShipmentModal');
const shipmentModal = document.getElementById('shipmentModal');
const shipmentModalInstance = bootstrap.Modal.getOrCreateInstance(shipmentModal);
const shipmentForm = document.getElementById("shipmentForm");
const provinceSelect = document.getElementById('provinceSelect');
const localitySelect = document.getElementById('localitySelect');
const typeSelect = document.getElementById('typeSelect');
const priceSelect = document.getElementById('priceSelect');
const phoneInput = document.getElementById('phoneInput');
const senderInput = document.getElementById('senderInput');
const inputsForm = shipmentForm.querySelectorAll('[name]');
const createShipmentButton = document.getElementById('createShipmentButton');

let table;
let alpineShipment = Alpine.$data(shipmentModal);
let alpinePrinter = Alpine.$data(printerModal);
let expandedRows = new Set();
const uap = new UAParser();

document.addEventListener('DOMContentLoaded', function () {
    initializeTable();
});

async function initializeTable() {
    if (table) {
        table.destroy();
    }

    table = await new DataTable('#shipmentsTable', {
        ajax: {
            url: '/api/v1/shipments/',
            type: 'GET',
            dataSrc: ''
        },
        columnDefs: [
            {
                targets: '_all',
                className: 'text-center align-middle'
            }
        ],
        columns: [
            {
                data: null,
                defaultContent: '<i class="ti ti-id fs-4 detail-control" style="cursor: pointer;"></i>',
                responsivePriority: 0,
                searchable: false
            },
            {
                data: 'tracking_number',
                responsivePriority: 2
            },
            {
                data: 'sender',
                responsivePriority: 3
            },
            {
                data: 'recipient',
                responsivePriority: 1
            },
            {
                data: 'total_amount',
                responsivePriority: 4,
                searchable: false,
                render: function (data, type, row) {
                    if (type === 'display' || type === 'filter' || type === 'sort') {
                        if (data !== null && data !== undefined && data > 0) {
                            formattedData = parseFloat(data).toLocaleString('es-AR', { minimumFractionDigits: 0, maximumFractionDigits: 0, useGrouping: true });
                            return `<p class="text-success mb-0 fs-6 fw-bold">${formattedData}</p>`;
                        } else {
                            return '<i class="ti ti-currency-dollar-off d-block text-danger fs-5 fw-bold" style="line-height: 0;"></i>';
                        }
                    }
                    return data;
                }
            },
            {   
                title: 'Fecha de ingreso',
                data: 'creation_date',
                visible: false
            },
            {   
                title: 'Estado',
                data: 'status.name',
                visible: false
            },
            {   
                title: 'Provincia',
                data: 'province',
                visible: false
            },
            {   
                title: 'Localidad',
                data: 'locality',
                visible: false
            }
        ],
        ordering: false,
        processing: true,
        responsive: true,
        scrollY: '67vh',
        scrollCollapse: true,
        paging: false,
        info: false,
        select: {
            style:  'os',
            selector: 'td:not(:first-child)'
        },
        language: {
            url: '/static/json/es.json'
        },
        dom: "<'mb-2 d-flex flex-column flex-sm-row justify-content-between p-0 m-0' <'d-inline' B> <f> >" + "<'row'<'col-md-12'tr>>",
        buttons: [
            {   
                text: '<div class="d-flex justify-content-center align-items-center"><i class="ti ti-file-type-pdf fs-5"></i></div>',
                extend: 'pdfHtml5',
                className: 'btn btn-dark shadow-none',
                customize: function (doc) {
                    const currentDate = new Date();
                    const options = { day: '2-digit', month: '2-digit', year: 'numeric' };
                    const formattedDate = currentDate.toLocaleDateString('es-ES', options);

                    doc.defaultStyle.fontSize = 9;
                    doc.defaultStyle.alignment = 'center';

                    doc.content.splice(0, 1);
                    
                    doc.content.splice(0, 0, {
                        margin: [0, 0, 0, 15],
                        columns: [
                            {
                                text: formattedDate,
                                alignment: 'left',
                                width: '*',
                                bold: true,
                                fontSize: 11
                            },
                            {
                                text: 'GUIA DE TRASLADO DE ENCOMIENDAS',
                                alignment: 'center',
                                width: '*',
                                bold: true,
                                fontSize: 10
                            },
                            {
                                text: '',
                                width: '*',
                            }
                        ]
                    });

                    doc.content.splice(1, 0, {
                        margin: [0, 0, 0, 12],
                        columns: [
                            {
                                width: 100,
                                alignment: 'start',
                                image: 'data:image/png;base64,'
                            },
                            {   
                                width: '*',
                                alignment: 'right',
                                text: [
                                    { text: 'FUNDACION LOGISTICA SOLIDARIA\n', fontSize: 8, bold: true },
                                    { text: '30-71896341-5\n', fontSize: 8 },
                                    { text: 'Necochea 35, Resistencia - Chaco', fontSize: 8 }
                                ]
                            }
                        ]
                    });

                    doc.content.splice(3, 0, {
                        margin: [0, 40, 0, 0],
                        columns: [
                            {
                                text: [
                                    { text: 'DEP. DE ORIGEN: BOGOTA 3066, FLORES - CABA\n', margin: [0, 0, 0, 20] },
                                    { text: 'DEP. DESTINO: NECOCHEA 35, RESISTENCIA - CHACO\n' }
                                ],
                                alignment: 'left',
                                width: '*',
                                fontSize: 10
                            },
                            {
                                columns: [
                                    {
                                        text: [
                                            { text: '----------------------\n', alignment: 'center' },
                                            { text: 'FIRMA CONDUCTOR', alignment: 'center' }
                                        ],
                                        width: '*'
                                    },
                                    {
                                        text: [
                                            { text: '----------------------\n', alignment: 'center' },
                                            { text: 'FIRMA EMPRESA', alignment: 'center' }
                                        ],
                                        width: '*'
                                    }
                                ],
                                alignment: 'right',
                                width: '*'
                            }
                        ]
                    });
                }
            }
        ]
    });

    table.on('click', '.detail-control', function (e) {
        let tr = e.target.closest('tr');
        let row = table.row(tr);
        let rowData = row.data();
        let trackingNumber = rowData.tracking_number;

        if (row.child.isShown()) {
            row.child.hide();
            expandedRows.delete(trackingNumber);
        } else {
            row.child(showDetails(rowData)).show();
            expandedRows.add(trackingNumber);
        }
    });

    table.on('draw.dt', function () {
        if (expandedRows.size > 0) {
            table.rows().every(function () {
                let rowData = this.data();
                if (rowData && expandedRows.has(rowData.tracking_number)) {
                    if (!this.child.isShown()) {
                        this.child(showDetails(rowData)).show();
                    }
                }
            });
        }
    });
};

function showDetails(data) {
    console.log(data);
    return (
        `
        <div class="d-flex flex-column gap-2 my-2" id="detailOrder">
            <div class="text-center">
                <h2 class="text-decoration-underline link-offset-1 fs-4">Detalles del envio</h2>
            </div>
            <div class="d-flex flex-column gap-2 flex-lg-row align-items-center justify-content-center justify-content-md-around">
                <div class="d-flex flex-column gap-2 text-center">
                    <p class="mb-0"><strong>Fecha de creacion:</strong> ${data.creation_date}</p>
                    <p class="mb-0"><strong>Numero de seguimiento:</strong> ${data.tracking_number}</p>
                    <p class="mb-0"><strong>Remitente:</strong> ${data.sender}</p>
                    <p class="mb-0"><strong>Destinatario:</strong> ${data.recipient}</p>
                </div>
                <div class="d-flex flex-column gap-2 text-center">
                    <p class="mb-0"><strong>Numero de telefono:</strong> ${data.phone}</p>
                    <p class="mb-0"><strong>Estado:</strong> ${data.status.name}</p>
                </div>
            </div>
        </div>
        `
    );
};

showShipmentModal.addEventListener('click', async () => {
    typeSelect.replaceChildren(typeSelect.firstElementChild);
    priceSelect.replaceChildren(priceSelect.firstElementChild);
    provinceSelect.replaceChildren(provinceSelect.firstElementChild);
    
    shipmentModalInstance.show();

    try {
        let response = await fetch('https://apis.datos.gob.ar/georef/api/provincias');
        let data = await response.json();

        if (!response.ok) {
            showNotification('error', 'Error de servidor', 'Hubo un problema al obtener las provincias.');
            return;
        }

        const naturalSort = (a, b) => {
            return a.nombre.localeCompare(
                b.nombre,
                'es',
                {
                    sensitivity: 'base',
                    numeric: true
                }
            );
        };

        const orderedProvinces = data.provincias.sort(naturalSort);

        const allowedProvinceIds = ['02', '06', '14', '18', '22', '30', '34', '82'];

        orderedProvinces
            .filter(province => allowedProvinceIds.includes(province.id.toString()))
            .forEach(province => {
                let option = document.createElement('option');
                option.value = province.nombre;
                option.text = province.nombre;
                provinceSelect.appendChild(option);
            });
    } catch (error) {
        if (error.message.includes("Failed to fetch") || error.name === "TypeError") {
            showNotification('error', 'Error de conexion', 'Verifique la conexion de internet.');
        } else {
            showNotification('error', 'Error inesperado', 'Ocurrio un desconocido.');
        }
    }

    try {
        let response = await fetch('/api/v1/packages_categories/');
        let data = await response.json();

        if (!response.ok) {
            showNotification('error', 'Error de servidor', 'Hubo un problema al obtener las categorias.');
            return;
        }

        data.package_types.forEach(type => {
            typeSelect.innerHTML += `<option value="${type.id}">${type.name}</option>`;
        });

        data.package_prices.forEach(price => {
            priceSelect.innerHTML += `<option value="${price.id}">${price.name} - $${price.mount}</option>`;
        });
    } catch (error) {
        if (error.message.includes("Failed to fetch") || error.name === "TypeError") {
            showNotification('error', 'Error de conexion', 'Verifique la conexion de internet.');
        } else {
            showNotification('error', 'Error inesperado', 'Ocurrio un desconocido.');
        }
    }
});

provinceSelect.addEventListener('change', async (selection) => {
    let provinceId = selection.target.value;

    localitySelect.replaceChildren(localitySelect.firstElementChild);
    localitySelect.selectedIndex = 0;

    try {
        let response = await fetch(`https://apis.datos.gob.ar/georef/api/municipios?provincia=${provinceId}&campos=id,nombre&max=1000`);
        let data = await response.json();

        if (!response.ok) {
            showNotification('error', 'Error de servidor', 'Hubo un problema al obtener las localidades.');
            return;
        }

        const naturalSort = (a, b) => {
            return a.nombre.localeCompare(
                b.nombre,
                'es',
                {
                    sensitivity: 'base',
                    numeric: true
                }
            );
        };

        const orderedLocations = data.municipios.sort(naturalSort);

        orderedLocations.forEach(locality => {
            let option = document.createElement('option');
            option.value = locality.nombre;
            option.textContent = locality.nombre;
            localitySelect.appendChild(option);
        });

        localitySelect.disabled = false;
    } catch (error) {
        if (error.message.includes("Failed to fetch") || error.name === "TypeError") {
            showNotification('error', 'Error de conexion', 'Verifique la conexion de internet.');
        } else {
            showNotification('error', 'Error inesperado', 'Ocurrio un desconocido.');
        }
    }
});

phoneInput.addEventListener('input', (event) => {
    let value = event.target.value.replace(/\D/g, '');

    if (value.length > 10) {
        value = value.slice(0, 10);
    }

    event.target.value = value;
});

createShipmentButton.addEventListener('click', async () => {
    const formData = new FormData(shipmentForm);

    alpineShipment.isLoading = true;

    try {
        const response = await fetch('/api/v1/create_shipment/', {
            method: 'POST',
            body: formData,
            headers: {
                'X-CSRFToken': getCookie('csrftoken')
            }
        });
        const data = await response.json();

        if (!response.ok) {
            if (response.status === 400) {
                const errorFields = data.fields;

                inputsForm.forEach(inputElement => {
                    const fieldName = inputElement.name;
    
                    if (errorFields.includes(fieldName)) {
                        inputElement.classList.add('is-invalid');
                    } else {
                        inputElement.classList.remove('is-invalid');
                    }
                });
            }

            showNotification(data.type, data.title, data.message);
            return;
        }

        showNotification(data.type, data.title, data.message);
        table.ajax.reload();
        shipmentModalInstance.hide();
    } catch (error) {
        showNotification('error', 'Error al contactar con el servidor');
    } finally {
        alpineShipment.isLoading = false;
    }
});

shipmentModalInstance._element.addEventListener('hidden.bs.modal', () => {
    provinceSelect.replaceChildren(provinceSelect.firstElementChild);
    provinceSelect.selectedIndex = 0;

    localitySelect.replaceChildren(localitySelect.firstElementChild);
    localitySelect.selectedIndex = 0;

    inputsForm.forEach(inputElement => {
        inputElement.classList.remove('is-invalid');
    });

    shipmentForm.reset();
    localitySelect.disabled = true;
});

showPrinterModal.addEventListener('click', async () => {
    printerSelect.replaceChildren(printerSelect.firstElementChild);
    printerModalInstance.show();

    alpinePrinter.isLoading = true;

    try {
        const response = await fetch("http://localhost:8000/impresoras");
        const data = await response.json();

        if (!response.ok) {
            showNotification('error', 'Error del servidor', 'Hubo un problema al obtener las impresoras.');
            return;
        }

        const osName = uap.getOS().name;
        let printersAvailable;

        if (osName === 'Windows') {
            printersAvailable = data.map(printer);
        } else if (osName === 'Android') {
            printersAvailable = data.map(printer => printer.mac);
        }

        if (printersAvailable.length === 0) {
            showNotification('info', 'Error de dispositivo', 'No se encontraron impresoras disponibles.');
            return;
        }

        printersAvailable.forEach(printer => {
            printerSelect.innerHTML += `<option value="${printer}">${printer}</option>`;
        });

        alpinePrinter.withoutPrinters = false;
    } catch (error) {
        if (error.message.includes("Failed to fetch") || error.name === "TypeError") {
            showNotification('error', 'Error de conexion', 'Verifique que el servidor de impresion este encendido.');
        } else {
            showNotification('error', 'Error inesperado', 'Ocurrio un desconocido.');
        }
    } finally {
        alpinePrinter.isLoading = false;
    }
});

savePrinterButton.addEventListener('click', () => {
    const selectedPrinter = printerSelect.value;
    setCookie('selectedPrinter', selectedPrinter);

    showNotification('success', 'Configuracion exitosa', `La impresora ${selectedPrinter} se usara para imprimir.`);
    printerModalInstance.hide();
});

printerModalInstance._element.addEventListener('hidden.bs.modal', () => {
    printerSelect.replaceChildren(printerSelect.firstElementChild);

    alpinePrinter.isLoading = true;
    alpinePrinter.withoutPrinters = true;
});